import React, { useState } from "react";

// Example data structure for specific electives
const electiveOptions = {
  "System Elective": [
    "CSCE 410 - Operating Systems",
    "CSCE 412 - Cloud Computing",
    "CSCE 416 - Hardware Design Verification",
    "CSCE 426 - Security of Embedded Systems",
  ],
  "Software Elective": [
    "CSCE 431 - Software Engineering",
    "CSCE 434 - Compiler Design",
    "CSCE 435 - Parallel Computing",
    "CSCE 438 - Distributed Objects Programming",
  ],
  "Information/Intelligence Elective": [
    "CSCE 420 - Artificial Intelligence",
    "CSCE 421 - Machine Learning",
    "CSCE 436 - Computer-Human Interaction",
    "CSCE 441 - Computer Graphics",
  ],
  "Tracked Elective I": [
    "CSCE 305 - Computational Data Science",
    "CSCE 310 - Database Systems",
    "CSCE 320 - Principles of Data Science",
  ],
  "Tracked Elective II": [
    "CSCE 443 - Game Development",
    "CSCE 446 - Virtual Reality",
    "CSCE 452 - Robotics and Spatial Intelligence",
  ],
  "Untracked Elective": [
    "CSCE 402 - Law & Policy in Cybersecurity",
    "CSCE 477 - Cybersecurity Risk",
    "CSCE 469 - Advanced Computer Architecture",
  ],
};

const CoursesLeft = ({ coursesLeft = [] }) => {
  const [selectedTerms, setSelectedTerms] = useState(
    Array.isArray(coursesLeft)
      ? coursesLeft.reduce((acc, category) => {
          category.courses.forEach((course) => {
            acc[course.name] = {
              term: course.term || "",
              notes: course.notes || "",
              selectedOption: "", // For dynamic dropdown options
            };
          });
          return acc;
        }, {})
      : {}
  );

  const handleTermChange = (courseName, term) => {
    setSelectedTerms((prev) => ({
      ...prev,
      [courseName]: { ...prev[courseName], term },
    }));
  };

  const handleOptionChange = (courseName, selectedOption) => {
    setSelectedTerms((prev) => ({
      ...prev,
      [courseName]: { ...prev[courseName], selectedOption },
    }));
  };

  const handleNotesChange = (courseName, notes) => {
    setSelectedTerms((prev) => ({
      ...prev,
      [courseName]: { ...prev[courseName], notes },
    }));
  };

  const handleSubmit = () => {
    console.log("Selected Terms, Options, and Notes:", selectedTerms);
  };

  return (
    <div style={containerStyles}>
      <h1>Remaining Courses</h1>
      {coursesLeft.map((category) => (
        <div key={category.category} style={categoryStyles}>
          <h2>{category.category}</h2>
          <div style={headerStyles}>
            <span style={courseHeaderStyles}>Course</span>
            <span style={termHeaderStyles}>Term</span>
            <span style={notesHeaderStyles}>Notes</span>
          </div>
          {category.courses.map((course) => (
            <div key={course.name} style={courseRowStyles}>
              {electiveOptions[course.name] ? (
                <>
                  <span style={courseNameStyles}>{course.name}</span>
                  <select
                    value={selectedTerms[course.name]?.selectedOption || ""}
                    onChange={(e) => handleOptionChange(course.name, e.target.value)}
                    style={dropdownStyles}
                  >
                    <option value="">Select Course</option>
                    {electiveOptions[course.name].map((option) => (
                      <option key={option} value={option}>
                        {option}
                      </option>
                    ))}
                  </select>
                </>
              ) : (
                <span style={courseNameStyles}>{course.name}</span>
              )}
              <select
                value={selectedTerms[course.name]?.term || ""}
                onChange={(e) => handleTermChange(course.name, e.target.value)}
                style={dropdownStyles}
              >
                <option value="">Select Term</option>
                <option value="Fall 2024">Fall 2024</option>
                <option value="Spring 2025">Spring 2025</option>
                <option value="Fall 2025">Fall 2025</option>
                <option value="Spring 2026">Spring 2026</option>
              </select>
              <input
                type="text"
                placeholder="Add notes here"
                value={selectedTerms[course.name]?.notes || ""}
                onChange={(e) => handleNotesChange(course.name, e.target.value)}
                style={notesInputStyles}
              />
            </div>
          ))}
        </div>
      ))}
      <button onClick={handleSubmit} style={buttonStyles}>
        Submit
      </button>
    </div>
  );
};

// Styles
const containerStyles = {
  padding: "20px",
  fontFamily: "Arial, sans-serif",
  maxWidth: "900px",
  margin: "0 auto",
};

const categoryStyles = {
  marginBottom: "20px",
};

const headerStyles = {
  display: "flex",
  justifyContent: "space-between",
  padding: "10px 0",
  borderBottom: "2px solid #ccc",
  fontWeight: "bold",
  marginBottom: "10px",
};

const courseRowStyles = {
  display: "flex",
  justifyContent: "space-between",
  alignItems: "center",
  marginBottom: "10px",
  gap: "10px",
};

const courseHeaderStyles = {
  flex: 3,
  textAlign: "left",
};

const termHeaderStyles = {
  flex: 1,
  textAlign: "center",
};

const notesHeaderStyles = {
  flex: 2,
  textAlign: "center",
};

const courseNameStyles = {
  flex: 3,
  textAlign: "left",
};

const dropdownStyles = {
  flex: 1,
  padding: "5px",
  borderRadius: "4px",
  border: "1px solid #ccc",
  height: "36px",
};

const notesInputStyles = {
  flex: 2,
  padding: "5px",
  borderRadius: "4px",
  border: "1px solid #ccc",
  height: "36px",
};

const buttonStyles = {
  padding: "10px 20px",
  backgroundColor: "#007BFF",
  color: "#fff",
  border: "none",
  borderRadius: "4px",
  cursor: "pointer",
  marginTop: "20px",
};

export default CoursesLeft;
